import React, { useEffect } from "react";
import "../component-styles/Planner.scss";
import Sidebar from "./Sidebar";

const Planner = () => {
  return (
    <main className="layout">
      <section className="sidebar">
        <Sidebar>
          <Link to="/">home</Link>
        </Sidebar>
      </section>
    </main>
  );
};

export default Planner;
